import React, { Component } from 'react'
import "./index.css"

class ListItem extends Component {
    render() {
        return (
            
                <div className="todoc">
                    <h3 className="header1">List Items</h3>
                    <ul>
                        <li>List one</li>
                        <li>List Two</li>
                        <li>List Three</li>
                        <li>List Four</li>
                        <li>List Five</li>
                    </ul>
                </div>
            
        )
    }
}

export default ListItem;
